text:
@cprepharbor Upper School scholars studied the work of Dorothea Lange, who was a photographer that gained fame by taking portraits during #theGreatDepression. While analyzing the impact of photographs as primary sources, scholars were tasked with photographing their lives during quarantine. Our hope that is that by creating these projects we are building a primary source for future generations to use as they study the impact of Covid-19. - Ms. Winant, Illuminator, 9th/10th Grade History #wearecapitalprep

